/*Table structure for table `fl_article` */

DROP TABLE IF EXISTS `fl_article`;

CREATE TABLE `fl_article` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `typeid` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '栏目ID',
  `tuijian` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '推荐等级',
  `click` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击量',
  `title` varchar(150) NOT NULL DEFAULT '' COMMENT '标题',
  `body` mediumtext COMMENT '内容',
  `writer` varchar(20) NOT NULL DEFAULT '' COMMENT '作者',
  `source` varchar(30) NOT NULL DEFAULT '' COMMENT '来源',
  `litpic` varchar(100) NOT NULL DEFAULT '' COMMENT '缩略图',
  `pubdate` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `keywords` varchar(60) NOT NULL DEFAULT '' COMMENT '关键词',
  `seotitle` varchar(150) NOT NULL DEFAULT '' COMMENT 'SEO标题',
  `description` varchar(250) NOT NULL DEFAULT '' COMMENT '描述',
  `ischeck` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否审核，默认0审核',
  `typeid2` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '副栏目id',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '是谁发布的',
  `listorder` int(5) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `writer` (`writer`),
  KEY `idx_typeid_ischeck` (`typeid`,`ischeck`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='文章表';

/*Data for the table `fl_article` */

insert  into `fl_article`(`id`,`typeid`,`tuijian`,`click`,`title`,`body`,`writer`,`source`,`litpic`,`pubdate`,`addtime`,`keywords`,`seotitle`,`description`,`ischeck`,`typeid2`,`user_id`,`listorder`) values (1,4,0,467,'移动网站建设常见问题','<p>移动网站兴起时间不长，站长有很多相似的问题。在2014年11月份的百度移动搜索沙龙上，移动专家针对站长提问较多的问题进行了统一回答，与往期沙龙的零星回答合并整理如下：<br/></p><p><br/></p><p>问：我的移动站内容和PC站是一样的，这样需不需要屏蔽百度的PC搜索蜘蛛？</p><p><br/></p><p>答：由于百度的PC搜索和移动搜索共用同一个spider，都带有baidu标示，不要进行屏蔽。Spider在抓取时会对页面进行识别，自动判断是PC页还是mobile页，因此建议站长使用规范的html5/xhtml协议语言来建设移动站。</p><p><br/></p><p>问：手机站使用xhtml与html5开发，对搜索引擎是否有区别？</p><p><br/></p><p>答：大家使用手机搜索时会发现用2G的情况下移动搜索会给你到极速版，就是保证你得到结果的速度足够快，但是结果样式比较简单。一般情况下极速版我们会优先给Xhtml的结果，触屏版优先给html5,效果更加炫酷。</p><p><br/></p><p>问：如果是URL、PC访问和移动访问分别识别不同的模版，例如我们有一个URL，PC访问是是这个模版，手机访问是那个模版。那么我们是使用相同的URL好，还是单独的做一个M站好？</p><p><br/></p><p>答：理想状态下同一套url是最优的。目前受限于机制问题，还有待进一步解决，预期14年底能够完成。目前仍然建议大家移动站使用单独的m链接。同时，暂时不要使用类似这样的url：http://m.site.com?src=http://www.site.com。</p><p><br/></p><p>问：感谢，我们是这样理解吧，未来的话如果以用户习惯来说，是同一个URL好？</p><p><br/></p><p>答：理想的技术角度看，是同一个url更好，但是目前尽量仍然使用单独的m链接。</p><p><br/></p><p>问：一个站点有M站和PC站，采用完全相同的TDK，是否有问题，手机站的SEO规则是否跟PC站相同？</p><p><br/></p><p>答：TDK代表标题、摘要、关键词是吧？先理解一下。是这样的，PC端和移动端搜索结果展现标题和摘要的字数限制等都是不同的，PC端30多个中文汉字才截断，移动端不到20个就折行了，20多个就省略看不到了。所以，建议移动站使用单独的TDK。</p><p><br/></p><p>问：如果两个站点它的TDK都是完全相同的，每一个页面，会不会导致站点被惩罚？</p><p><br/></p><p>答：这里说的两个站如果指同一个站点的PC和移动，肯定是不会导致被惩罚的。</p><p><br/></p><p>问：外链对手机站是否有效果？</p><p><br/></p><p>答：外链还是有效果的，但不要做那些垃圾外链，比如说论坛的标签里面或者说买卖链接或者是说批量的发链接有可能被惩罚。正常交换一下链接是有帮助的。0和1是明显不同的。</p><p><br/></p><p>问：百度移动搜索对我的移动站收录较少，该如何做？</p><p><br/></p><p>答：1.如果您同时具有PC站，且PC与移动站是一一对应的关系，请利用开放适配工具进行提交，既可以帮助移动站的收录又可以帮助您将PC站的排名转移至移动搜索；2.如果您只有移动站，也可以通过我们的移动sitemap工具向百度进行提交。</p>','','','',1476454862,1476063853,'移动,网站建设,常见问题','','移动网站兴起时间不长，站长有很多相似的问题。在2014年11月份的百度移动搜索沙龙上，移动专家针对站长提问较多的问题进行了统一回答，与往期沙龙的零星回答合并整理如下：问：我的',0,0,0,50),(2,2,1,353,'对百度搜索引擎友好的网站结构','<p>我们在做网站结构相关SEO工作时，都应该考虑以下四个问题：<br/></p><p>1，Baiduspider能不能找到所有网页</p><p>2，Baiduspider是否知道哪个网页是重要的</p><p>3，Baiduspider能否顺利提取网页内容</p><p>4，Baiduspider能否在网页中提炼有用信息&nbsp;</p><p><br/></p><p>下面讲的内容便是解决前两个问题的：</p><p><br/></p><p>一，友好的网站结构</p><p><br/></p><p>1，扁平or树型：一说到网站结构，大家都会提到扁平结构和树型结构，言必称“结构扁平化”，这些指的是物理结构，即基于内容聚合的目录及文件位置决定的结构。其实对于百度搜索引擎来说，只要结构合理、有逻辑性、内容有规律可循都可以，都是友好的。</p><p><br/></p><p>2，链接结构：相对于物理结构，就要说到逻辑结构：即通过内部链接形成的链接结构，逻辑结构才是搜索引擎最关注的。对于一个网站来说，网页仅仅可以通过首页——目录1——目录2一层一层follow到是远远不够的，一个优秀的链接结构应该是网状的。</p><p><br/></p><p>1）首页链接应该链向重要的频道页，频道页再链向下面的节点页或普通页面。同时，频道页、节点页和普通页面都应该可以链回到首页</p><p>2）无论哪些页面之间互相链接，都需要一个描述恰当的锚文本</p><p>3）链接不要放在JS、FLASH等搜索引擎不可见的位置，使用图片做链接入口应该完善alt标签</p><p>&nbsp; &nbsp;*百度搜索引擎目前仅支持对部分JS和FLASH进行解析，绝大多数放在JS和FLASH里的链接都是获取不到的</p><p>4）为重要页面留更多入口。百度搜索引擎认为，获得更多内部投票的网页相对来说更加重要</p><p>5） “离首页越近”的网页，越容易受到百度重视。这个“近”指的是页面离首页的点击距离。即使URL所在目录层级较深，只要在首页有入口，百度也认为这是一个非常重要的页面。</p><p>6）不要产生可怕的孤岛页面。虽然百度在提交入口、社会化挖掘方面做了许多工作，但链接抓取依然是百度获得新页面的最重要渠道</p><p><br/></p><p>二，通过导航让百度更好地认识站点</p><p><br/></p><p>对于用户，导航要解决的问题是：我在网站的什么位置，我想看上一级、甚至上上一级更多内容的入口在哪里；对于spider，导航要解决的问题是：这个页面属于哪个领域，要表达的主题是什么。所以说，清晰的导航系统不仅有助于提高用户体验，对SEO的意义也是重大的，所有SEO做得出色的网站基本都拥有清晰明确的导航。</p><p><br/></p><p>1，导航内容搜索引擎可见：有网站的导航对用户来说美观友好，对百度来说却是不可见的。目前百度还不能搞定所有的JS和FLASH，保险起见，还是使用HTML的好。图片虽然美丽，作为导航也是对搜索引擎不友好的行为。</p><p><br/></p><p>2，导航稳定：导航内容应该是相对固定的，不要让导航成为“滚动条”。</p><p><br/></p><p>3，重要网页尽可能地在导航处可以follow到：百度认为主导航中出现的链接，其重要性仅次于网站首页，所以应该尽量将站内的页面在主导航中安排个位置。当然，主导航上也不可能放过多的内容，哪些链接可以上主导航还需要SEO人员进行平衡。</p><p><br/></p><p>4，巧用面包屑导航：上面说到，导航对于用户来说，解决了“想看上一级、甚至上上一级更多内容”的问题，这个导航指的就是面包屑导航。面包屑导航可以使结构复杂庞大的大中型网站变得清晰轻盈，在spider进行页面解析时会着重查看面包屑导航内容，强烈建议使用。</p><p><br/></p><p>三，合理的domain结构</p><p><br/></p><p>除了在网站建设的时候站长会思考到底使用二级域名还是子目录，在网站运营的过程中，也会考虑是否要把子目录的内容拆分成二级域名。因为很多SEO人员认为二级域名相对独立，其首页会得到百度的重视，能获得更好的排位——其实这是一个片面的错误观点，百度会通过很多指标对同domain下的二级域名和子目录进行重要程度判断，并没有武断地认为谁天生就会比谁强一些。</p><p><br/></p><p>当SEO认为站内结构已经阻碍了网站高速发展就会考虑改版，最常见的改版便是将子目录移出主站点、单独形成二级域名。但大家都知道，改版肯定会对站点的收录排名和流量造成影响，一定要谨慎。那么在什么情况下才真的需要将子目录换成二级域名呢？其实只有一点：即子目录的内容足够丰富，且与主域的主题关联性不强！</p><p><br/></p><p>四，url结构很重要</p><p><br/></p><p>1，url结构规律化：同一个网页有不同url，会造成多个url同时被用户推荐导致权值分散；同时百度最终选择展现的那个url不一定符合你的预期。站点应该尽量不把sessionid和统计代码等不必要的内容放在url，如果一定要这样做可以通过robots禁止百度抓取这些非规范url</p><p><br/></p><p>2，最好能让用户从url即可判断出网页内容，便于蜘蛛解析的同时便于用户间传播</p><p><br/></p><p>3，url尽量短</p><p><br/></p><p>●蜘蛛喜欢：http://tieba.baidu.com.com/f?kw=百度</p><p>●蜘蛛不喜欢：http://tieba.baidu.com/f?ct=&amp;tn=&amp;rn=&amp;ln=&amp;cn=0&amp;kw=百度&amp;rs2=&amp;un=&amp;rs1=&amp;rs5=&amp;sn=&amp;rs6=&amp;nvselectvalue=0&amp;oword=百度&amp;tb=cn</p><p><br/></p><p>4，不要添加蜘蛛难以解析的字符，如</p><p>http://mp3.XXX.com/albumlist/234254;;;;;;;%B9&amp;CE%EDWF%.html</p><p>http://news.xxx.com/1233,242,111,0.shtml</p><p><br/></p><p>5，动态参数不要太多太复杂，目前百度对动态url已经有了很好的处理，但是参数过多过复杂的url有可能被蜘蛛认为不重要而抛弃。</p>','','','/images/3.jpg',1476454546,1476063905,'对,百度,搜索引擎,友,好的,网站,结构','','我们在做网站结构相关SEO工作时，都应该考虑以下四个问题：1，Baiduspider能不能找到所有网页2，Baiduspider是否知道哪个网页是重要的3，Baiduspider能否顺利提取网页内容4，Baiduspider能否在网页',0,0,0,50),(3,1,1,379,'在移动搜索展现端获得良好表现的注意事项','<p>移动网站优化和PC网站的很多方面都是相似甚至相同的，但由于移动搜索界面大小受限，移动网站在标题和摘要的撰写上有很多有别有PC端的情况。<br/></p><p><br/></p><p>1，有吸引力的title</p><p><br/></p><p>用户在百度移动搜索中输入query搜索到你的页面时，title作为最重要的内容展现在搜索结果中，主题明确、吸引眼球的title能够使用户第一时间理解你页面的主题是否符合他的需求，进而更快捷地从众多搜索结果中选择你点击你。所以，移动网页的TITLE应该是：</p><p><br/></p><p>●主题明确；</p><p><br/></p><p>●简洁扼要，不罗列，尽量不超过17个中文汉字，否则会折行；</p><p><br/></p><p>●如果你的品牌知名度高，品牌词最好能够展现出来；</p><p><br/></p><p>●在与内容相符的前提下，吸引眼球</p><p><br/></p><p>2，不唯一的description,</p><p><br/></p><p>作为搜索结果摘要的重要选择目标之一，一定不要采用默认形式，用适当的语言对页面进行进一步描述，对title的进一步补充，能够使用户更进一步理解你页面的内容与其需求是否匹配，让你的目标用户更快找到你点击你。</p><p><br/></p><p>●对title的进一步补充，准确描述页面内容，但不堆砌关键词，否则可能被认为有作弊嫌疑；</p><p><br/></p><p>●每个页面要有不同的description，尽量不适用默认一样的；</p><p><br/></p><p>●适当的长度，超出会被截断.</p>','','','',1496551932,1476063946,'在,移动,搜索,展现,端,获得,良好,表现,的,注意事项','','移动网站优化和PC网站的很多方面都是相似甚至相同的，但由于移动搜索界面大小受限，移动网站在标题和摘要的撰写上有很多有别有PC端的情况。1，有吸引力的title用户在百度移动搜索中输',0,0,1,50),(4,2,0,248,'撰写搜索引擎喜欢的标题','<p>通过观察可以发现，那些可以从搜索引擎获得大批流量的站点来说，SEO思维渗透到了每个岗位，产品人员在提交项目MRD时，网页标题的写法是必不可少的一部分；编辑对文章内容负责的同时，要设计出吸引用户和搜索引擎的标题；而不是单纯地把优化工作全部扔给SEO人员。所以，今天我们想跟产品人员和编辑说说网页标题该怎么写。<br/></p><p><br/></p><p>一，标题的结构</p><p><br/></p><p>1，标题字数控制在60个字节内：从以往的经验看，检索用户比较喜欢50个字节左右的标题；对于产品人员和编辑来说，过短的标题有可能无法全面表达网页主题；对于搜索引擎来说，标题过长意味着“超标”，只会保留前60个字节的内容。</p><p><br/></p><p>【反面case】福州到北京旅游_北京旅游天气如何_北京旅游景点介绍_北京好玩吗_现在去北京旅游会热吗</p><p><br/></p><p>2，重要内容放在标题的最前面：在众多检索结果中，用户的目光往往聚焦在标题前半段，所以重要信息内容放在标题前部非常重要。</p><p><br/></p><p>【正面case】关之琳否认脑癌发作称洗牙遭误会|关之琳|癌症_凤凰娱乐</p><p><br/></p><p>3，放置网站名称，增加曝光机会：有些站点已经在某领域有了一定的知名度和权威性，其站名名称已经成为一种品牌，可以将该品牌词体现在标题中，用户在面对众多结果时，更倾向于选择点击自己熟知网站提供的信息。即使网站目前的知名度还不够，更不应该放过每个品牌曝光的机会。</p><p><br/></p><p>【正面case:】【单电和微单的区别】-蜂鸟网</p><p><br/></p><p>【正面case】法国卢浮宫博物馆藏文物精品在中国国家博物馆展出-新华网</p><p><br/></p><p>二，标题放什么内容更吸引用户</p><p><br/></p><p>用户在百度搜索框输入关键词后，百度在对相关网页进行排序时，网页标题内容是其考虑的重要因素。同时，搜索结果页内通常会有10个结果，用户往往是通过标题和摘要来决定要点击开哪个结果。标题上关键词的选择至关重要。</p><p><br/></p><p>1，与网页内容最相关的关键词：首先，标题应该和网页内容相对应，即标题上的内容，可以在网页主体部分得到展示。一般来说，如果网页主要部分是一篇文章，网页标题的主要内容往往是文章标题；如果网页是一个综合信息的集合页，我们也要找到这些信息的共同点，通过一两个关键词将其表现在网页标题上。</p><p><br/></p><p>【正面case】婴儿哭闹的原因_婴儿期0-1岁_育儿知识_宝宝树</p><p><br/></p><p>2，选择用户更常用的关键词：同一个物品有不同的名称、同一件事情也有不同的描述，选择哪个放在title上呢？虽然百度有强大的关键词分析算法，但我们还是推荐大家使用搜索引擎用户最常用的那个。关键词的热度可以通过百度指数进行查询，目前网络上还有一些其它工具，大家也可以参考一下。</p><p><br/></p><p>如佳能有一款单反相机，标准全称是“5dmarkii”，简称“5D2”，广大搜索爱好者亲切地称之为“无敌兔”。从字面上看，“5dmarkii”输入起来比较麻烦。再看一下它们的百度指数：</p><p><br/></p><p>“5dmarkii”：257</p><p>“5D2”：875</p><p>“无敌兔”:467</p><p><br/></p><p>很明显，“5D2”由于指向清晰、朗朗上口且容易输入，最受搜索引擎用户喜爱</p><p><br/></p><p>3，选择能满足用户明确需求的关键词：能体现用户明确需求的关键词往往字数偏长，SEO人员一般称此为长尾关键词，如“杭州两日游路线”“从上海到西塘怎么走”等。我们的产品人员和编辑应该一方面了解用户需求，一方面制作可以满足用户需求的网页，通过将含有用户明确需求的关键词写在标题上来吸引搜索引擎用户的点击。</p><p><br/></p><p>【正面case】【宝宝补锌】儿童缺锌怎么办_怎样给孩子补锌-摇篮网</p><p><br/></p><p>4，在真实的前提下体现时效性：在标题放时效性关键词最重要的前提是：网页里真的有时效性内容，否则非常容易被搜索引擎惩罚。</p><p><br/></p><p>【正面case】2014-10月8万套北京北京二手房价格,真房价没水分!「链家」</p><p><br/></p><p>5，直击用户痛点，引发共鸣：还以上面那个case为例，虚假房源和房价一直是二手房买方心中的痛，“2014-10月8万套北京北京二手房价格,真房价没水分!「链家」”直面用户痛点，再配上“链家”的招牌，点击率一直居高不下。当然，这已经超越了SEO的范畴，相信编辑人员在这方面有更多经验。</p><p><br/></p><p>三，设计标题时避免做下面的事情</p><p><br/></p><p>1，欺骗用户和搜索引擎：有些网站在标题上放置过多重复意义的关键词，甚至放置与内容无关的热门关键词以吸引甚至欺骗用户和搜索引擎，这样很容易被搜索引擎判为作弊而受到惩罚，是一件非常危险的事情。所以：千万不要在标题中体现网页内没有的内容。</p><p><br/></p><p>【反面case1】青蛇完整_青蛇完整全集在线观看_青蛇完整完整版视频——该网页仅仅提供了片花视频</p><p><br/></p><p>【反面case2】李小璐不雅视频引撞脸门2万抵3万拒绝“撞楼”——该网页主要介绍的是楼盘信息</p><p><br/></p><p>2，避免多网页使用同一个标题：原则上每个网页都应该有自己独特的标题，如果整个网站的标题全部一致，将失去向搜索引擎表达含义的重要机会。</p>','','','/images/1.jpg',1476453850,1476063980,'撰写,搜索引擎,喜欢,的,标题','','通过观察可以发现，那些可以从搜索引擎获得大批流量的站点来说，SEO思维渗透到了每个岗位，产品人员在提交项目MRD时，网页标题的写法是必不可少的一部分；编辑对文章内容负责的同时',0,0,0,50),(5,3,0,337,'Baiduspider主要抓取策略类型','<p>Baiduspider在抓取过程中面对的是一个超级复杂的网络环境，为了使系统可以抓取到尽可能多的有价值资源并保持系统及实际环境中页面的一致性同时不给网站体验造成压力，会设计多种复杂的抓取策略。以下做简单介绍：<br/></p><p><br/></p><p>1、抓取友好性</p><p><br/></p><p>互联网资源庞大的数量级，这就要求抓取系统尽可能的高效利用带宽，在有限的硬件和带宽资源下尽可能多的抓取到有价值资源。这就造成了另一个问题，耗费被抓网站的带宽造成访问压力，如果程度过大将直接影响被抓网站的正常用户访问行为。因此，在抓取过程中就要进行一定的抓取压力控制，达到既不影响网站的正常用户访问又能尽量多的抓取到有价值资源的目的。</p><p><br/></p><p>通常情况下，最基本的是基于ip的压力控制。这是因为如果基于域名，可能存在一个域名对多个ip（很多大网站）或多个域名对应同一个ip（小网站共享ip）的问题。实际中，往往根据ip及域名的多种条件进行压力调配控制。同时，站长平台也推出了压力反馈工具，站长可以人工调配对自己网站的抓取压力，这时百度spider将优先按照站长的要求进行抓取压力控制。</p><p><br/></p><p>对同一个站点的抓取速度控制一般分为两类：其一，一段时间内的抓取频率；其二，一段时间内的抓取流量。同一站点不同的时间抓取速度也会不同，例如夜深人静月黑风高时候抓取的可能就会快一些，也视具体站点类型而定，主要思想是错开正常用户访问高峰，不断的调整。对于不同站点，也需要不同的抓取速度。</p><p><br/></p><p>2、常用抓取返回码示意</p><p><br/></p><p>简单介绍几种百度支持的返回码：</p><p><br/></p><p>1）最常见的404代表“NOTFOUND”，认为网页已经失效，通常将在库中删除，同时短期内如果spider再次发现这条url也不会抓取；</p><p><br/></p><p>2）503代表“ServiceUnavailable”，认为网页临时不可访问，通常网站临时关闭，带宽有限等会产生这种情况。对于网页返回503状态码，百度spider不会把这条url直接删除，同时短期内将会反复访问几次，如果网页已恢复，则正常抓取；如果继续返回503，那么这条url仍会被认为是失效链接，从库中删除。</p><p><br/></p><p>3）403代表“Forbidden”，认为网页目前禁止访问。如果是新url，spider暂时不抓取，短期内同样会反复访问几次；如果是已收录url，不会直接删除，短期内同样反复访问几次。如果网页正常访问，则正常抓取；如果仍然禁止访问，那么这条url也会被认为是失效链接，从库中删除。</p><p><br/></p><p>4）301代表是“MovedPermanently”，认为网页重定向至新url。当遇到站点迁移、域名更换、站点改版的情况时，我们推荐使用301返回码，同时使用站长平台网站改版工具，以减少改版对网站流量造成的损失。</p><p><br/></p><p>3、多种url重定向的识别</p><p><br/></p><p>互联网中一部分网页因为各种各样的原因存在url重定向状态，为了对这部分资源正常抓取，就要求spider对url重定向进行识别判断，同时防止作弊行为。重定向可分为三类：http30x重定向、metarefresh重定向和js重定向。另外，百度也支持Canonical标签，在效果上可以认为也是一种间接的重定向。</p><p><br/></p><p>4、抓取优先级调配</p><p><br/></p><p>由于互联网资源规模的巨大以及迅速的变化，对于搜索引擎来说全部抓取到并合理的更新保持一致性几乎是不可能的事情，因此这就要求抓取系统设计一套合理的抓取优先级调配策略。主要包括：深度优先遍历策略、宽度优先遍历策略、pr优先策略、反链策略、社会化分享指导策略等等。每个策略各有优劣，在实际情况中往往是多种策略结合使用以达到最优的抓取效果。</p><p><br/></p><p>5、重复url的过滤</p><p><br/></p><p>spider在抓取过程中需要判断一个页面是否已经抓取过了，如果还没有抓取再进行抓取网页的行为并放在已抓取网址集合中。判断是否已经抓取其中涉及到最核心的是快速查找并对比，同时涉及到url归一化识别，例如一个url中包含大量无效参数而实际是同一个页面，这将视为同一个url来对待。</p><p><br/></p><p>6、暗网数据的获取</p><p><br/></p><p>互联网中存在着大量的搜索引擎暂时无法抓取到的数据，被称为暗网数据。一方面，很多网站的大量数据是存在于网络数据库中，spider难以采用抓取网页的方式获得完整内容；另一方面，由于网络环境、网站本身不符合规范、孤岛等等问题，也会造成搜索引擎无法抓取。目前来说，对于暗网数据的获取主要思路仍然是通过开放平台采用数据提交的方式来解决，例如“百度站长平台”“百度开放平台”等等。</p><p><br/></p><p>7、抓取反作弊</p><p><br/></p><p>spider在抓取过程中往往会遇到所谓抓取黑洞或者面临大量低质量页面的困扰，这就要求抓取系统中同样需要设计一套完善的抓取反作弊系统。例如分析url特征、分析页面大小及内容、分析站点规模对应抓取规模等等。</p>','','','',1476454079,1476064033,'Baiduspider,主要,抓取,策略,类型','','Baiduspider在抓取过程中面对的是一个超级复杂的网络环境，为了使系统可以抓取到尽可能多的有价值资源并保持系统及实际环境中页面的一致性同时不给网站体验造成压力，会设计多种复杂',0,0,0,50),(6,1,0,396,'百度移动搜索优化前期准备工作','<p><strong>域名：</strong><br/></p><p><br/></p><p>与PC网站一样，域名是用户对一个网站的第一印象。一个好的移动域名，不仅容易记忆、易于输入，还能方便用户向其他人推荐。</p><p><br/></p><p>域名应尽量简短易懂，越短的域名记忆成本越低，越容易理解的域名能让用户更直观了解网站主旨。移动站域名建议多采用m.a.com/3g.a.com/wap.a.com等，避免使用过于复杂或技术性的形式，例如adcbxxx.a.com/html5.a.com等。</p><p><br/></p><p><strong>服务器：</strong></p><p><br/></p><p>选择正规空间服务商，避免与大量垃圾网站共用IP，保证网站访问速度和稳定性。其他这里不再赘述，默认有PC网站基础。</p><p><br/></p><p><strong>网站语言：</strong></p><p><br/></p><p>根据终端以及技术的发展，我们强烈建议使用html5作为移动站建站语言，并且根据不同终端机型进行自动适配。</p>','','','',1476454177,1476064079,'百度,移动,搜索,优化,前期,准备工作','','域名：与PC网站一样，域名是用户对一个网站的第一印象。一个好的移动域名，不仅容易记忆、易于输入，还能方便用户向其他人推荐。域名应尽量简短易懂，越短的域名记忆成本越低，越',0,0,0,50),(7,4,0,225,'Baiduspider抓取过程中涉及的网络协议','<p>百度搜索引擎会设计复杂的抓取策略，其实搜索引擎与资源提供者之间存在相互依赖的关系，其中搜索引擎需要站长为其提供资源，否则搜索引擎就无法满足用户检索需求；而站长需要通过搜索引擎将自己的内容推广出去获取更多的受众。spider抓取系统直接涉及互联网资源提供者的利益，为了使搜素引擎与站长能够达到双赢，在抓取过程中双方必须遵守一定的规范，以便于双方的数据处理及对接。这种过程中遵守的规范也就是日常中我们所说的一些网络协议。<br/></p><p><br/></p><p>以下简单列举：</p><p><br/></p><p>http协议：超文本传输协议，是互联网上应用最为广泛的一种网络协议，客户端和服务器端请求和应答的标准。客户端一般情况是指终端用户，服务器端即指网站。终端用户通过浏览器、蜘蛛等向服务器指定端口发送http请求。发送http请求会返回对应的httpheader信息，可以看到包括是否成功、服务器类型、网页最近更新时间等内容。</p><p><br/></p><p>https协议：实际是加密版http，一种更加安全的数据传输协议。</p><p><br/></p><p>UA属性：UA即user-agent，是http协议中的一个属性，代表了终端的身份，向服务器端表明我是谁来干嘛，进而服务器端可以根据不同的身份来做出不同的反馈结果。</p><p><br/></p><p>robots协议：robots.txt是搜索引擎访问一个网站时要访问的第一个文件，用以来确定哪些是被允许抓取的哪些是被禁止抓取的。robots.txt必须放在网站根目录下，且文件名要小写。详细的robots.txt写法可参考http://www.robotstxt.org。百度严格按照robots协议执行，另外，同样支持网页内容中添加的名为robots的meta标签，index、follow、nofollow等指令。</p>','','','',1476454131,1476064125,'Baiduspider,抓取,过程中,涉及,的,网络,协议','','百度搜索引擎会设计复杂的抓取策略，其实搜索引擎与资源提供者之间存在相互依赖的关系，其中搜索引擎需要站长为其提供资源，否则搜索引擎就无法满足用户检索需求；而站长需要通过',0,0,0,50),(8,4,1,281,'如何在百度移动搜索获得良好的排序','<p>同PC端的需求一样，收录问题解决后面临的就是排序问题了。在介绍排序原则之前先简休介绍一下移动搜索结果的构成，移动搜索主要有如下几类结果构成：移动页面、转码页面、PC页面。<br/></p><p><br/></p><p>整体上，移动搜索的结果是由PC搜索结果加入更多的移动端特征后进一步调整而来，优先对移动页面进行排序。其中，移动页面结果包括移动适配提交的与PC一一对应的移动页以及单独的移动页面。百度移动搜索引擎中为更好满足用户信息需求，会同时为用户提供PC网页和mobile网页，但目前大多数PC页在移动终端中直接浏览的体验较差（交互、兼容和流量等）。因此，我们会对百度搜索结果中缺乏可替代mobile资源的PC页进行格式转换，变为适合手机浏览的mobile网页，使其能在移动终端浏览器有较好的浏览体验，这便是转码页面。其他PC页面，是百度经过各种策略识别发现其没有对应的移动页面资源、且转码后体验不佳的情况下保留的一种结果类型。对于后两者我们强烈建议站长进行移动化。</p><p><br/></p><p>下面我们主要来说说如何才能在百度移动搜索获得良好的排序：</p><p><br/></p><p>1，需要主旨明确的标题：</p><p><br/></p><p>网页的title用于告诉用户和搜索引擎这个网页的主题是什么，搜索引擎判断一个页面内容权重时，title是主要因素之一。每个页面的内容都是不同的，都应该有独一无二的title。移动站的标题应该注意如下：</p><p><br/></p><p>1）主题明确，涵盖页面主旨内容；</p><p><br/></p><p>2）不罗列关键词，使用户能够快速分辨出主题，最好不超过17个中文汉字，否则在搜索结果中会被折行，超过24个会被截断；</p><p><br/></p><p>3）重要内容往左放，保持语义通顺；</p><p><br/></p><p>4）使用用户熟知或习惯用语</p><p><br/></p><p>百度建议不同层级页面的标题按照如下的形式来命名：</p><p><br/></p><p>●首页标题：网站名称_核心服务or核心产品</p><p><br/></p><p>●频道页标题：（频道核心服务_）频道名称_网站名称</p><p><br/></p><p>●详情页标题：文章标题_频道名称_网站名称</p><p><br/></p><p>2，优质的原创内容建设、整合系列服务：</p><p><br/></p><p>网站的服务对象是用户，搜索引擎只是网站普通用户中的一员，因此，一切从用户角度出发提供用户需要的原创内容、整合系列服务非常重要，每天保持一定数量的原创内容更新，同时可以对优质内容、系列服务进行整合形成专题。但是，鉴于技术的现状，仍然要注意如下几点：</p><p><br/></p><p>1）不要使用ajax技术在希望搜索引擎可读的地方；</p><p><br/></p><p>2）不将主要内容创建在iframe框架中；</p><p><br/></p><p>3）移动端很多内容使用图片，搜索引擎目前无法理解复杂图片，请使用alt标签进行标记；</p><p><br/></p><p>3，做好终端适配：</p><p><br/></p><p>随着移动互联网的发展，越来越多的用户使用移动设备访问网站，百度移动搜索会对移动站给予优先排序的机会，对于有PC网站的站长，我们强烈建议您做以下工作：</p><p><br/></p><p>1、做好自适配，将移动终端的访问自主适配跳转至移动版站点；</p><p><br/></p><p>2、为了更快地告知百度移动搜索您PC网站与移动站内容的一一对应关系，建议使用站长平台移动适配工具进行适配关系提交。</p><p><br/></p><p>3、同时还可以使用如下Meta标签协议规范：</p><p><br/></p><p>●如果该网页只适合在电脑上进行浏览，例如（http://www.sina.com.cn/），在html中加入如下meta：</p><p><br/></p><p>&lt;meta name=&quot;applicable-device&quot; content=&quot;pc&quot;&gt;</p><p><br/></p><p>●如果该网页只适合在移动设备上进行浏览，例如（http://3g.sina.com.cn/），在html中加入如下meta：</p><p><br/></p><p>&lt;meta name=&quot;applicable-device&quot; content=&quot;mobile&quot;&gt;</p><p><br/></p><p>●如果网页采用了响应式网页设计，例如（http://cdc.tencent.com/）不需要经过url自适配跳转就可以根据浏览器的屏幕大小自适应的展现合适的效果，同时适合在移动设备和电脑上进行浏览，在html中加入如下meta：</p><p><br/></p><p>&lt;meta name=&quot;applicable-device&quot; content=&quot;pc,mobile&quot;&gt;</p><p><br/></p><p>4，地理信息标注有助于获得更精准的流量：</p><p><br/></p><p>为了方便用户根据自身位置查找或使用本地信息与服务，百度移动搜索将根据用户地理位置信息优先将具有地域属性的内容展现给用户，如果是提供地域性信息服务的站点，可以通过为自己网页添加地理位置信息Meta标注，让目标用户在百度移动搜索中更快的找到您网站的内容。具体用法可见下一小节《如何为移动站点添加地理位置信息》</p><p><br/></p><p>5，尽量快的加载速度：</p><p><br/></p><p>移动互联网上，网站的打开速度对用户体验的影响更加凸显。实验表明一个页面的打开时间超过4~5s，绝大部分用户选择关闭。因此，加载速度也是百度移动搜索中一个重要的排序因素，站长需要在这方面进行专项优化。</p><p><br/></p><p>6，搜索结果转码：</p><p><br/></p><p>在移动终端中直接浏览PC页面体验较差（交互、兼容和流量等）。为改善搜索用户的浏览体验，我们会对搜索结果中缺乏可替代移动资源的PC页（无移动站）进行格式转换，变为适合手机浏览的移动网页。如想了解更多可参考：转码声明。我们强烈建议没有移动化的站长进行网站移动化，提交移动适配，将转码流量领回家。</p>','','','',1476454326,1476064196,'如,何在,百度,移动,搜索,获得,良,好的,排序','','同PC端的需求一样，收录问题解决后面临的就是排序问题了。在介绍排序原则之前先简休介绍一下移动搜索结果的构成，移动搜索主要有如下几类结果构成：移动页面、转码页面、PC页面。整',0,0,0,50),(9,2,3,404,'网页优化的大忌','<p>网页进行正常优化，有助于搜索引擎更好地了解网页主体内容，而网页优化同样是一柄双刃剑，搞不好会造成费力不讨好、甚至被搜索引擎惩罚的后果。在百度看来，网页优化的大忌有三点：<br/></p><p><br/></p><p>1，关键词过度堆彻：有些站点为了提高网站的相关性，在TITLE、description、keywords等地方进行关键词堆彻，非旦无法起到优化作用，还有可能被惩罚。</p><p><br/></p><p>*隐藏关键词我们就不用说了，完全是黑帽SEO的范畴，已不在优化之列。</p><p><br/></p><p>2，关键词过度优化：一些网页过度强调文章中的关键词，甚至将关键词生硬地穿插在文章中，这些都极容易被搜索引擎识别并惩罚。</p><p><br/></p><p>3，经常改变网页的TITLE和Description：每一次更换网页的TITLE和Description等标签，都有一个百度发现解析记录的过程，没有一个准确的时间段可以描述，如果这个过程时间很短可能不会造成恶劣影响，但如果时间较长，则有可能影响搜索用户的体验。所以说，网页的各种标签应该在网站建设阶段设计好。</p>','','','/images/2.jpg',1476453839,1476064241,'网页,优化,的,大忌','','网页进行正常优化，有助于搜索引擎更好地了解网页主体内容，而网页优化同样是一柄双刃剑，搞不好会造成费力不讨好、甚至被搜索引擎惩罚的后果。在百度看来，网页优化的大忌有三点',0,0,0,50),(10,3,0,394,'百度优先建重要库的原则','<p>Baiduspider抓了多少页面并不是最重要的，重要的是有多少页面被建索引库，即我们常说的“建库”。众所周知，搜索引擎的索引库是分层级的，优质的网页会被分配到重要索引库，普通网页会待在普通库，再差一些的网页会被分配到低级库去当补充材料。目前60%的检索需求只调用重要索引库即可满足，这也就解释了为什么有些网站的收录量超高流量却一直不理想。<br/></p><p><br/></p><p>那么，哪些网页可以进入优质索引库呢。其实总的原则就是一个：对用户的价值。包括却不仅于：</p><p><br/></p><p>1，有时效性且有价值的页面：在这里，时效性和价值是并列关系，缺一不可。有些站点为了产生时效性内容页面做了大量采集工作，产生了一堆无价值面页，也是百度不愿看到的.</p><p><br/></p><p>2，内容优质的专题页面：专题页面的内容不一定完全是原创的，即可以很好地把各方内容整合在一起，或者增加一些新鲜的内容，比如观点和评论，给用户更丰富全面的内容。</p><p><br/></p><p>3，高价值原创内容页面：百度把原创定义为花费一定成本、大量经验积累提取后形成的文章。千万不要再问我们伪原创是不是原创。</p><p><br/></p><p>4，重要个人页面：这里仅举一个例子，科比在新浪微博开户了，即使他不经常更新，但对于百度来说，它仍然是一个极重要的页面。</p>','','','',1476454498,1476064284,'百度,优先,建,重要,库,的,原则','','Baiduspider抓了多少页面并不是最重要的，重要的是有多少页面被建索引库，即我们常说的“建库”。众所周知，搜索引擎的索引库是分层级的，优质的网页会被分配到重要索引库，普通网页',0,0,0,50),(11,3,0,486,'禁止百度移动搜索对网页进行转码的方法','<p>在百度移动搜索引擎中，为了更好地满足用户需求，会同时为用户提供PC网页和mobile网页，但目前受交互、兼容和流量等因素影响，PC页在移动终端中的直接浏览体验较差。因此，百度移动搜索对缺乏可替代mobile资源的PC页进行格式转码，将其转换为适合手机浏览的mobile页，使其能够在移动终端浏览器有较好的浏览体验。为了最大程度改善PC页在手机上的浏览体验，转码时会去除PC页中不能在手机浏览器上浏览的内容，并改善不适用mobile的交互功能。目前不仅百度移动搜索提供转码技术，各大搜索引擎均有并提供类似的技术。<br/></p><p><br/></p><p>那么，如果站长不希望自己的站点被转码、依然希望手机端用户浏览PC页该如何操作呢？可以使用no-transform协议，no-transform协议为如下两种形式：</p><p><br/></p><p>第一种，HTTPResponse中显式声明Cache-control为no-transform。</p><p><br/></p><p>第二种，meta标签中显式声明Cache-control为no-tranform，格式为：</p><p><br/></p><p>&lt;head&gt;</p><p><br/></p><p>&lt;meta http-equiv=&quot;Cache-Control&quot; content=&quot;no-transform&quot;/&gt;</p><p><br/></p><p>&lt;/head&gt;</p><p><br/></p><p>如果站点不希望页面被转码，可添加此协议，当用户通过百度移动搜索进入该网站时会进入原网页浏览。</p><p><br/></p><p>还有一种情况，即站点本身有对应的mobile页面所以不希望被转码时，建议站长使用百度移动搜索的移动适配服务，百度会帮助用户直接进入对应的mobile页面。</p>','','','',1476454369,1476064353,'禁止,百度,移动,搜索,对,网页,进行,转,码,的,方法','','在百度移动搜索引擎中，为了更好地满足用户需求，会同时为用户提供PC网页和mobile网页，但目前受交互、兼容和流量等因素影响，PC页在移动终端中的直接浏览体验较差。因此，百度移动搜',0,0,0,50),(12,4,0,384,'网站内容创作的大忌','<p>网站制作内容是一件持续性投入的工作，在人力、技术、财力上都需要较大投入，一些站点急于求成寻找捷径，制作了很多垃圾内容，最终被搜索引擎惩罚，可谓得不偿失。希望站长抛弃以下行为，从《百度网页搜索质量白皮书》中寻找答案。<br/></p><p><br/></p><p>1，站内大量重复内容：很多网站，尤其是商业网站，往往使用同一个模板，不同网页的主体内容高度相似或相同，仅一些TITLE等标签进行了改变。比如一些招投标网站，为了让更多的地区得到投标内容，他们制作了大量页面，标题采用地区+内容的方式，而页面的主体内容都是完全相同的。再如下图，同样仅标题和图片不同，主体内容相对，对于百度搜索引擎来说，都属于站内大量重复内容。</p><p><br/></p><p>2，利用与站点无关的热词引流：有些网站，尤其是新闻源站点紧盯百度的时效性热词，与自己网站文章的标题进行整合，其实就是我们常说的标题党，如“李娜退役隐情体育明星豪宅全揭秘”，用户点击后自然看不到关于李娜退役隐情的内容。此种行为一经发现，网站会被取消新闻源资格，即使内容真的是原创，也会因此行为遭受牵连。</p><p><br/></p><p>3，制作低质静态搜索结果页或TAG标签页：很多网站都采用了将站内搜索结果页转为静态页面的方式，整合站点资源，以期形成相关性得分高的页面。但实际来看，很多站点通过站内搜索或者tag生成的页面相关性并不好，或者说产生了许多对百度搜索结果造成负面影响的页面。如果整个目录都存在这样的现象，那么被惩罚的可能性就非常大了。如下方截图，用户搜“列车时刻表”，这样的页面对他来说毫无价值。该页面所在的目录或站点做了很多类似内容的页面，且已经对作用造成恶劣影响时，极容易受到搜索引擎的惩罚。</p><p><br/></p><p>4，不负责任的采集：首先需要澄清的是，百度说的拒绝采集，指的是大量复制互联网上已有内容，对采集的内容不加整理即全部推至线上的“偷懒”行为。对于将采集来的内容进行再加工高效整合后，产出内容丰富的高质量网页，百度没有拒绝理由。所以，我们说，百度不喜欢不负责任的偷懒采集行为。</p><p><br/></p><p>5，伪原创：上面我们说百度不喜欢不负责任的采集，于是有些人开始动起了伪装原创的脑筋。采集内容后对部分关键词进行批量修改，企图让百度认为这些都是独特内容，然而内容已经是面目全非，甚至无法读通——这也是百度不喜欢的，风险很大。还是刚才说的观点，百度不排斥站点采集内容，关键是如何应用采集的内容和数据，如何整合成用户和搜索引擎都需要的内容才是站长应该考虑的内容。</p>','','','',1483178699,1476454002,'网站,内容,创作,的,大忌','','网站制作内容是一件持续性投入的工作，在人力、技术、财力上都需要较大投入，一些站点急于求成寻找捷径，制作了很多垃圾内容，最终被搜索引擎惩罚，可谓得不偿失。希望站长抛弃以',1,0,1,50),(13,3,0,464,'获得流量的基础——良好收录','<p>搜索引擎作为网站的普通访客，对网站的抓取索引、对站点/页面的价值判定以及排序，都是从用户体验出发。因此，原则上网站任何对用户体验的改进，都是对搜索引擎的改进。但是限于当前整体的网络环境以及技术性原因，落实用户体验的具体手段也是需要考虑对搜索引擎友好性的，使之在满足用户体验的前提下也会让搜索引擎更易理解处理。那么，面向移动搜索引擎的网站建设，主要分为三个部分：如何更好的让百度移动搜索收录网站中的内容、如何在移动搜索中获得更好的排名、如何让用户从众多的搜索结果中快速地找到并点击你的网站。简单来说，就是收录、排序、展现。下面我们将从收录开始介绍：<br/></p><p><br/></p><p><strong>机器可读：</strong></p><p><br/></p><p>与PCspider一样，百度通过一个叫Baiduspider2.0的程序抓取移动互联网上的网页，经过处理后建入移动索引中。当前Baiduspider只能读懂文本内容，flash、图片等非文本内容暂时不能很好处理，放置在flash、图片中的文字，百度只能简单识别。建议使用文本而不是flash、图片、Javascript等来显示重要的内容或链接，搜索引擎暂时无法识别Flash、图片、复杂Javascript中的内容；同时仅存在于flash、Javascript中包含链接指向的网页，百度移动搜索同样可能无法收录。不要在希望搜索引擎可读的地方使用Ajax技术，比如标题、导航、内容等等。</p><p><br/></p><p><strong>结构扁平：</strong></p><p><br/></p><p>移动站点同样应该有清晰的结构以及更浅的链接深度，这能够使用户快速地获取有用信息，也能使搜索引擎快速理解网站中的每一个页面所处的结构层次。网站结构建议采用树型结构，树型结构通常分为以下三个层级：首页——频道——详情页。</p><p><br/></p><p><strong>网状链接：</strong></p><p><br/></p><p>理想的网站结构是树型扁平，从首页到内容页的层级尽量少，这样更有利于搜索引擎进行处理。同时，网站内的链接也应该采用网状结构，网站上每个网页都要有指向上、下级网页以及相关内容的链接，避免出现链接孤岛：首页有到频道页的链接，频道页有到首页和普通内容页的链接、普通内容页有到上级频道以及首页的链接、内容相关的网页间互相有链接。网站中每一个网页，都应该是网站结构的一部分，都应该能通过其他网页链接到，这样才能使baiduspider尽可能全地遍历网站内容。同时，重要内容应该距离首页更近，有利于价值传递。</p><p><br/></p><p><strong>简单易懂的URL：</strong></p><p><br/></p><p>具有良好描述性、规范、简单的URL，有利于用户更方便地记忆和直观判断网页内容，也有利于搜索引擎更有效地抓取和理解网页。网站设计之初，就应该有合理的URL规划。我们认为：</p><p><br/></p><p>1、对于移动站首页一般采用m.a.com/3g.a.com/wap.a.com；</p><p><br/></p><p>2、频道页采用m.a.com/n1/、m.a.com/n2/（其对应于PC站点的频道n2.a.com），当然，n1、n2直接可读更佳；</p><p><br/></p><p>3、详情页的URL尽量短，减少无效参数，例如统计参数等，保证同一页面只有一套URL地址，不同形式的URL301跳转到正常URL上；</p><p><br/></p><p>4、Robots封禁baiduspider抓取您不想展示给用户的URL形式以及不愿被百度抓取的私密数据。</p><p><br/></p><p><strong>涵盖主旨的anchor：</strong></p><p><br/></p><p>anchor即锚文本，对一个链接的描述性文字，锚文本写得越简洁明确，用户越易明白该指向网页的主旨内容。用户发现你的网页是从其他网页上的链接，锚文本是该网页的唯一介绍。跟普通用户相同，搜索引擎spider在刚发现一个网页时，锚文本也是对该页面理解的唯一因素，同时对于最终的排序起到具有一定的作用。</p><p><br/></p><p><strong>合理的返回码：</strong></p><p><br/></p><p>百度spider在进行抓取和处理时，是根据http协议规范来设置相应逻辑的，常用的几个返回码如下：</p><p><br/></p><p>404，百度会认为网页已失效已删除，通常在索引中删除，短期内spider再次遇到也不会抓取。建议内容删除、网页失效等的情况下使用404返回码，告知百度spider该页面已失效。同时网站中尽量减少死链的累计。如果网站临时关闭或抓取压力过大，不要直接返回404，使用503。</p><p><br/></p><p>301，永久性重定向，百度会认为当前URL永久跳转至新URL。当网站改版、更换域名等情况下，建议使用301，同时配合使用站长平台的网站改版工具。</p><p><br/></p><p>503，百度会认为临时不可访问，不会直接删除，短期内再来检查几次。如果网站临时性关闭建议使用503。</p>','','','',1476454233,1476064847,'获得,流量,的,基础,—,—,良好,收录','','搜索引擎作为网站的普通访客，对网站的抓取索引、对站点/页面的价值判定以及排序，都是从用户体验出发。因此，原则上网站任何对用户体验的改进，都是对搜索引擎的改进。但是限于当',0,0,0,50),(14,4,0,330,'知名站点优化注意事项','<p>百度需要优质站点为搜索引擎数据库源源不断地输入物料，同时优质站点也需要从百度获得搜索引擎用户，并将这些搜索引擎用户转化为自己的用户。知名站点可以视为优质站点的一部分，是指已经有较高用户知名度的网站。那么，站点越是知名，就越应从长远考虑，以用户体验为重，积极、合理的进行网站优化，远离作弊和恶意SEO行为，建立与百度更加稳固的合作关系。<br/></p><p><br/></p><p>但我们经常可以遗憾地看到一些知名站点使用了不够合理的内容建设方式，比如：大量不同内容的页面均使用同一标题；通过图片的方式展现网页中的重要信息（新闻、联系电话等）；重要页面通过flash建设，未使用文字说明等。</p><p><br/></p><p>类似的方式，都会使搜索引擎对网站内容的理解造成困难，最终影响网站在搜索引擎中的表现。我们建议您采取对搜索引擎友好的方式进行网站建设，具体内容可参考《百度搜索引擎优化指南》以及《百度搜索引擎网页质量白皮书》。</p><p><br/></p><p>知名站点对搜索引擎，乃至整个互联网欢迎的影响通常是巨大的，若使用恶意的作弊行为，其产生的影响也就越坏。例如：</p><p><br/></p><p>●出售首页的友情链接。</p><p><br/></p><p>●大量采集其他网站的内容，原创内容比例极低，甚至大量采集网站主题无关的内容，或机器批量生成没有价值的页面。</p><p><br/></p><p>●网站被大量广告内容占领。</p><p><br/></p><p>知名站点一旦有恶意的作弊行为，所产生的恶劣影响将是巨大的，有可能会受到搜索引擎更为严格的惩罚。知名站点更应从长远考虑，提升用户口碑，用高质量的内容赢得用户青睐。不应为了短期的流量，不顾用户的体验，做有损品牌形象的事情。</p><p><br/></p><p>此外，知名站点也是各路作弊者的“众矢之的”，容易被恶意利用。站点越知名，被利用的价值就越大。我们建议您建立防范意识，避免由于被作弊者利用引起的不必要风险。</p><p><br/></p><p>●您的站点是否足够安全？当网站被黑客攻击时，是否有足够的应对机制？</p><p><br/></p><p>●由用户贡献内容的功能，是否做好了应对作弊的措施？</p><p><br/></p><p>●对于不想让搜索引擎收录的内容，是否在robot.txt中清晰指明？</p>','百度站长','','',1483178708,1476453609,'知名,站点,优化,注意事项','','百度需要优质站点为搜索引擎数据库源源不断地输入物料，同时优质站点也需要从百度获得搜索引擎用户，并将这些搜索引擎用户转化为自己的用户。知名站点可以视为优质站点的一部分，',0,0,1,50),(15,3,0,433,'获得关键词数据的渠道有哪些','<p>上面说到了站点收集关键词的方向，那么通过什么渠道可以获取关键词数据呢。关键词收集也可以叫关键词拓展，其实就是思路的拓展。这个思路在工作岗位中的表现不同：产品运营的角度，可能是个不断深挖行业用户需求、了解需求、站在用户角度想问题设计产品；而从搜索营销、seo角度它则成为深挖行业用户需求的具体体现。那么获取关键词数据的主要渠道有哪些呢：<br/></p><p><br/></p><p>1，公开渠道：</p><p><br/></p><p>1）几家搜索引擎搜索结果相关搜索、SUG</p><p><br/></p><p>2）几家大的社交、媒体（微博）的相关搜索</p><p><br/></p><p>3）各搜索引擎的风云榜</p><p><br/></p><p>4）竞价关键词获取工具（搜索引擎一般都提供）</p><p><br/></p><p>5）百度司南工具</p><p><br/></p><p>6）cnzz数据中心（http://data.cnzz.com/）；</p><p><br/></p><p>2，通过站内工具：</p><p><br/></p><p>1）Log日志关键词数据；</p><p><br/></p><p>2）站内搜索关键词数据；</p><p><br/></p><p>3）商务通、商桥等在线咨询工具内的关键词；</p><p><br/></p><p>3，观察竞争对手：</p><p><br/></p><p>1）竞争对手网站上的tag页；</p><p><br/></p><p>2）竞争对手（尤其是对seo很重视的）站点title；</p><p><br/></p><p>3）竞争对手竞价关键词；</p><p><br/></p><p>4）竞争对手页面keyword；</p><p><br/></p><p>4，购买：</p><p><br/></p><p>1）寻找数据公司、工具服务商，购买数据</p><p><br/></p><p>5，常识拓展：</p><p><br/></p><p>1）问答类（百度知道、知乎）相关问题的提问挖掘</p><p><br/></p><p>2）内容评论中的需求挖掘，主题下的评论一定是跟这个主题紧密相关的关注点、bbs评论</p><p><br/></p><p>3）通过了解行业用户组合关键词，如：地区+关键词</p><p><br/></p><p>最后，就像大家知道的那样，即便这项工作真的很重要，但在如今碎片需求满足程度和信息内容大爆发的情况下，关注关键词背后的深层需求的分析、内容的差异提供、需求针对的产品细化，比不停的扩大关键词量要更重要的多。</p>','','','',1522304646,1476453964,'获得,关键词,数据,的,渠道,有,哪些','','上面说到了站点收集关键词的方向，那么通过什么渠道可以获取关键词数据呢。关键词收集也可以叫关键词拓展，其实就是思路的拓展。这个思路在工作岗位中的表现不同：产品运营的角度',0,0,1,50);

/*Table structure for table `fl_attachment` */

DROP TABLE IF EXISTS `fl_attachment`;

CREATE TABLE `fl_attachment` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '上传用户ID',
  `storage_type` tinyint(11) unsigned NOT NULL DEFAULT '2' COMMENT '附件存储类型: 0.本地自有服务器存储, 1.普通外部URL链接, 2.阿里云OSS云存储',
  `file_key` varchar(256) NOT NULL DEFAULT '' COMMENT '存储平台的key值',
  `file_url` varchar(256) NOT NULL DEFAULT '' COMMENT '文件Url访问地址',
  `filesize` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '文件大小, 以KB记',
  `ip` varchar(20) NOT NULL DEFAULT '' COMMENT '文件上传IP地址',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `file_url` (`file_url`(255)),
  KEY `admin_id` (`user_id`),
  KEY `storage_type` (`storage_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `fl_attachment` */

/*Table structure for table `fl_bonus` */

DROP TABLE IF EXISTS `fl_bonus`;

CREATE TABLE `fl_bonus` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '优惠券就是红包',
  `name` varchar(60) NOT NULL DEFAULT '' COMMENT '名称',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '金额',
  `min_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '满多少使用',
  `start_time` datetime NOT NULL COMMENT '开始时间',
  `end_time` datetime NOT NULL COMMENT '结束时间',
  `point` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '兑换优惠券所需积分,如果是0表示禁止兑换',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态：0可用，1不可用',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `num` int(11) NOT NULL DEFAULT '-1' COMMENT '优惠券数量，预留，-1表示不限',
  `delete_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间,默认0未删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='优惠券表';

